import React from 'react';

export default class MovieItem extends React.Component {
    render() {
        const { Title, Year, Type, Poster} = this.props.movieInfo
        return (
            <div>
                <div>{Title}</div>
                <div>{Year}</div>
                <div>{Type}</div>
                <img src={Poster} />
                <button>Add To List</button>
            </div>
        )
    }
}
